# Novogeorgiyevka, Tarumovsky District, Republic of Dagestan

}}
Novogeorgiyevka () is a rural locality (a selo) and the administrative center of  Novogeorgiyevsky Selsoviet, Tarumovsky District, Republic of Dagestan, Russia. Population:  There are 19 streets.
Geography
Novogeorgiyevka is located 20&nbsp;km south of Tarumovka (the district's administrative centre) by road. Bondarenovskoye is the nearest rural locality.
